import React from "react";
import { useWindowDimensions } from "react-native";
import Svg, { G, Circle, Path, Defs } from "react-native-svg";

const SendSvg = (props) => {
  const { width, height } = useWindowDimensions();
  const svgSize = Math.min(width, height) * 0.1; // Adjust the scaling factor as needed

  const triangleHeight = svgSize * 0.6; 
  const triangleWidth = triangleHeight / Math.sqrt(3); 

  return (
    <Svg xmlns="http://www.w3.org/2000/svg" width={svgSize} height={svgSize} fill="none" {...props}>
      <G filter="url(#a)">
        <Circle cx={svgSize / 2} cy={svgSize * 0.46875} r={svgSize * 0.46875} fill="#fff" />
      </G>
      <Path
        stroke="#0076B9"
        strokeWidth={svgSize * 0.05}
        d={`M${svgSize * 0.5} ${svgSize * 0.46875 - triangleHeight / 2} l${-triangleWidth / 2} ${triangleHeight / 2} h${triangleWidth} Z`}
      />
      <Path
        stroke="#000"
        strokeOpacity={0.2}
        strokeWidth={svgSize * 0.05}
        d={`M${svgSize * 0.5} ${svgSize * 0.46875 - triangleHeight / 2} l${-triangleWidth / 2} ${triangleHeight / 2} h${triangleWidth} Z`}
      />
      <Defs></Defs>
    </Svg>
  );
};

export default SendSvg;
